import React from 'react';
import subscribe from '../../subscribe-img.png';
import '../../App.css';

class Subscribe extends React.Component {
	render() {
		return (
			<React.Fragment>
				<div className='container my-5'>
						<div className='col-12 mx-auto'>
							<img src={subscribe} alt='banner' className='subscribe-img'></img>
						</div>
				</div>
			</React.Fragment>
		)
	}
}

export default Subscribe;
